import NavBar from "./NavBar"
import yose from './yosemite.jpg'

const Header = () => {
  return (
    <page
      style={{
        backgroundImage: `url(${yose})`,
      }}>
      <NavBar />
      <div className="header-text">
          <h1>Andrew Pritchett</h1>
          <p>Software Engineer | Climber</p>
      </div>
    </page>
  )
}

export default Header
